INSERT INTO `tblannouncements` (`id`, `date`, `title`, `announcement`, `published`, `parentid`, `language`, `created_at`, `updated_at`) VALUES
(3, '2023-08-06 07:18:00', 'Exciting Announcements: Upgraded Data Centers, Redesigned Website, and Premium Hosting Plans!', '<p>Dear Valued Client,</p>\r\n<p>We are excited to announce some significant changes that will enhance your experience with us at DEP Hosting. As part of our continuous commitment to delivering top-notch services, we are proud to inform you about the following updates:</p>\r\n<p><strong>New Data Centers:</strong></p>\r\n<p>We have invested in state-of-the-art data centers to ensure even greater reliability, security, and performance for your hosted websites and applications. These data centers are equipped with cutting-edge technology, redundant power systems, and advanced security measures to provide you with the best possible hosting environment.</p>\r\n<p><strong>Website and Client Area Redesign:</strong></p>\r\n<p>We have revamped our website and client area to provide you with a more intuitive, user-friendly, and visually appealing experience. Our redesigned interface will make it easier for you to manage your hosting services, access important information, and get support whenever you need it.</p>\r\n<p><strong>Introducing Premium Hosting Plans:</strong></p>\r\n<p>To cater to your diverse hosting needs, we are introducing a range of premium hosting plans, designed to suit different requirements and budgets. These new plans include:</p>\r\n<p>Shared Hosting: Ideal for individuals and small businesses looking for cost-effective hosting solutions without compromising on performance.</p>\r\n<p>Cloud Hosting: Enjoy the flexibility and scalability of cloud infrastructure for your growing online projects.</p>\r\n<p>WordPress Hosting: Optimized and tailored specifically for WordPress-powered websites, ensuring optimal speed and security.</p>\r\n<p>Reseller Hosting: Empower yourself to start your web hosting business with our feature-rich reseller hosting plans.</p>\r\n<p>And more: We have a variety of hosting plans to meet your specific needs and help you achieve your online goals.</p>\r\n<p><strong>Special Offers and Discounts:</strong></p>\r\n<p>As a token of our appreciation for your continued support, we will be offering exclusive promotions and discounts on our premium hosting plans. Keep an eye on your inbox for these limited-time offers.</p>\r\n<p><strong>Seamless Migration Assistance:</strong></p>\r\n<p>For our existing clients, we will provide seamless migration assistance to move your current hosting services to our upgraded infrastructure and enjoy the benefits of our premium plans. Our support team will be available round-the-clock to assist you throughout the process.</p>\r\n<p>We remain committed to delivering the best hosting solutions, outstanding customer service, and cutting-edge technology. These changes are a reflection of our dedication to your success and satisfaction.</p>\r\n<p>We sincerely thank you for being a valued client and look forward to serving you with these enhanced services. If you have any questions or need assistance, please don\'t hesitate to contact our support team.</p>\r\n<p>Best regards,</p>\r\n<p>DEP Hosting</p>', 1, 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, '2023-09-02 09:44:00', 'Important Update Regarding Your Free Web Hosting Plan', '<p>Dear Valued Customer,</p>\r\n<p>We want to address a recent issue regarding our free web hosting services, precisely our \"Unlimited Plan,\" which was designed to offer you unlimited domains. We understand that some of our users who ordered this plan have experienced limitations (1 Domain) access. We sincerely apologize for any inconvenience this may have caused.</p>\r\n<p>Our team has been working tirelessly to resolve this issue, and we would like to update you on the current status and steps we are taking to rectify it:</p>\r\n<p>1. <strong>Investigation Underway</strong>: We are actively investigating the technical issues that have caused certain users to experience limitations in their domain hosting capabilities.</p>\r\n<p>2. <strong>Immediate Assistance</strong>: If you have been affected by this issue, please reach out to our support team at <a href=\"mailto:info@dep.com.np\">info@dep.com.np</a> or <strong>contact our live support team</strong> through our website. Our dedicated support staff will assist you promptly in resolving any domain-related limitations you may be facing.</p>\r\n<p>3. <strong>Transparent Communication</strong>: We believe in transparent communication and will keep you updated on the progress of the investigation and the resolution of this issue. Rest assured, we are committed to providing you with the unlimited domain hosting that was promised to you.</p>\r\n<p>We understand how important your online presence is to you, and we are fully dedicated to ensuring that you receive the reliable and unrestricted web hosting services you deserve.</p>\r\n<p>Once again, we sincerely apologize for any inconvenience you may have faced, and we appreciate your trust in us. We are committed to resolving this matter promptly and ensuring that you have the best hosting experience with us.</p>\r\n<p>Thank you for choosing DEP Hosting as your web hosting provider. We value your business and are here to assist you every step of the way.</p>\r\n<p></p>\r\n<p>Best Regards,</p>\r\n<p>Customer Support Team</p>\r\n<p></p>', 1, 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, '2023-09-19 15:45:00', 'Exciting News for Our Valued Users at DEP Hosting!', '<p>Introducing Our New Reseller Plan with FREE Trial Server Access! ????</p>\r\n<p>At DEP Hosting, we\'re delighted to introduce our enhanced Reseller Plan, now with a FREE trial server! ????</p>\r\n<p></p>\r\n<p>Key Highlights:</p>\r\n<ul>\r\n<li>Free Trial Server: Test our reseller features without impacting your production work!</li>\r\n<li>Upgrade Opportunities: Enjoy FREE plan updates for enhanced performance.</li>\r\n<li>Seamless WHM Panels: Experience our user-friendly interface.</li>\r\n</ul>\r\n<p>Our trial server is designed exclusively for reseller users, allowing you to explore our WHM panels and features without any production workload. It\'s your chance to see how DEP Hosting can empower your hosting business.</p>\r\n<p>Don\'t miss out on this opportunity to elevate your hosting services. Join us today and take advantage of the FREE trial server.</p>\r\n<p>Remember to use promo code <strong>\"FREE\"</strong> during sign-up to access this special offer.</p>\r\n<p>Ready to get started? Reach out to our support team or visit our website for complete details.</p>\r\n<p>Thank you for choosing DEP Hosting. Your trust means the world to us, and we\'re dedicated to providing top-notch hosting solutions.</p>\r\n<p>Stay tuned for more exciting updates from DEP Hosting! </p>', 1, 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
