(1, 1, 'FTP', '{\"email_type\":\"general\",\"selected_ids\":[],\"client_status\":[\"Active\",\"Inactive\",\"Closed\"],\"client_group\":[],\"client_country\":[\"IN\",\"NP\"],\"client_language\":[\"\",\"english\"],\"custom_fields\":[],\"package_ids\":[],\"product_statuses\":[],\"servers\":[],\"send_for_each\":false,\"addon_ids\":[],\"addon_statuses\":[],\"domain_statuses\":[],\"email_opt_out\":\"\",\"total_recipients\":13}', '{\"type\":\"general\",\"subject\":\"FTP Problem Completely Resolved !!\",\"message\":\"&lt;p&gt;Dear Valued Hosting Clients,&lt;\\/p&gt;\\r\\n&lt;p&gt;We are pleased to announce that the FTP (File Transfer Protocol) issue that some of you have experienced in recent days has been successfully resolved. We understand that this problem has caused inconvenience and frustration, and we sincerely apologize for any disruption it may have caused.&lt;\\/p&gt;\\r\\n&lt;p&gt;Our dedicated technical team has worked tirelessly to identify and rectify the root causes of the FTP problem, ensuring a stable and efficient hosting environment for all our clients. We have implemented robust measures to prevent similar issues from occurring in the future, and we are committed to maintaining the highest standards of service reliability.&lt;\\/p&gt;\\r\\n&lt;p&gt;Here&#039;s what you can expect:&lt;\\/p&gt;\\r\\n&lt;p&gt;1.&lt;strong&gt; Seamless FTP Services&lt;\\/strong&gt;: You can now enjoy uninterrupted access to your FTP services for all your file transfer and management needs.&lt;\\/p&gt;\\r\\n&lt;p&gt;2. &lt;strong&gt;Enhanced Monitoring&lt;\\/strong&gt;: We have bolstered our monitoring systems to proactively identify and address any potential issues before they impact your hosting experience.&lt;\\/p&gt;\\r\\n&lt;p&gt;3. &lt;strong&gt;Reliable Support&lt;\\/strong&gt;: Our support team is available 24\\/7 to assist you with any questions, concerns, or additional support you may require.&lt;\\/p&gt;\\r\\n&lt;p&gt;4. &lt;strong&gt;Improved Communication&lt;\\/strong&gt;: In the unlikely event of future issues, we will keep you informed with regular updates and transparent communication.&lt;\\/p&gt;\\r\\n&lt;p&gt;We understand that trust is essential in our partnership, and we are committed to maintaining the high standards you expect from us. We greatly appreciate your patience and understanding throughout this period.&lt;\\/p&gt;\\r\\n&lt;p&gt;If you encounter any lingering issues or have any questions, please do not hesitate to reach out to our support team at info@dep.com.np or by visiting our support portal. We are here to assist you and ensure your hosting experience remains top-notch.&lt;\\/p&gt;\\r\\n&lt;p&gt;Once again, we apologize for any inconvenience this FTP problem may have caused, and we thank you for your continued trust in DEP Hosting. We look forward to serving you with excellence in the future.&lt;\\/p&gt;\\r\\n&lt;p&gt;\\u00a0&lt;\\/p&gt;\\r\\n&lt;p&gt;Best Regards,&lt;\\/p&gt;\\r\\n&lt;p&gt;Online Tech Team&lt;\\/p&gt;\\r\\n&lt;p&gt;DEP Hosting&lt;\\/p&gt;\",\"fromName\":\"DEP Hosting\",\"fromEmail\":\"billing@dep.com.np\",\"copyTo\":[\"\"],\"blindCopyTo\":[\"\"],\"temporaryAttachments\":[]}', '2023-09-11 15:47:00', 0, 0, 0, 0, 0, NULL, NULL, '2023-09-11 15:54:16', '2023-09-19 15:49:23', '2023-09-19 15:49:23'),
(2, 1, 'direct', '{\"email_type\":\"general\",\"selected_ids\":[],\"client_status\":[\"Active\",\"Inactive\",\"Closed\"],\"client_group\":[],\"client_country\":[\"IN\",\"NP\"],\"client_language\":[\"\",\"english\"],\"custom_fields\":[],\"package_ids\":[],\"product_statuses\":[],\"servers\":[],\"send_for_each\":false,\"addon_ids\":[],\"addon_statuses\":[],\"domain_statuses\":[],\"email_opt_out\":\"\",\"total_recipients\":14}', '{\"type\":\"general\",\"subject\":\"Introducing Our New Reseller Plan with FREE Trial Server Access!\",\"message\":\"&lt;p&gt;Introducing Our New Reseller Plan with FREE Trial Server Access!&lt;\\/p&gt;\\r\\n&lt;p&gt;At DEP Hosting, we&#039;re delighted to introduce our enhanced Reseller Plan, now with a FREE trial server!&lt;\\/p&gt;\\r\\n&lt;p&gt;Key Highlights:&lt;\\/p&gt;\\r\\n&lt;ul&gt;\\r\\n&lt;li&gt;Free Trial Server: Test our reseller features without impacting your production work!&lt;\\/li&gt;\\r\\n&lt;li&gt;Upgrade Opportunities: Enjoy FREE plan updates for enhanced performance.&lt;\\/li&gt;\\r\\n&lt;li&gt;Seamless WHM Panels: Experience our user-friendly interface.&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n&lt;p&gt;Our trial server is designed exclusively for reseller users, allowing you to explore our WHM panels and features without any production workload. It&#039;s your chance to see how DEP Hosting can empower your hosting business.&lt;\\/p&gt;\\r\\n&lt;p&gt;Don&#039;t miss out on this opportunity to elevate your hosting services. Join us today and take advantage of the FREE trial server.&lt;\\/p&gt;\\r\\n&lt;p&gt;Remember to use promo code\\u00a0&lt;strong&gt;&quot;FREE&quot;&lt;\\/strong&gt;\\u00a0during sign-up to access this special offer.&lt;\\/p&gt;\\r\\n&lt;p&gt;Ready to get started? Reach out to our support team or visit our website for complete details.&lt;\\/p&gt;\\r\\n&lt;p&gt;Thank you for choosing DEP Hosting. Your trust means the world to us, and we&#039;re dedicated to providing top-notch hosting solutions.&lt;\\/p&gt;\\r\\n&lt;p&gt;Stay tuned for more exciting updates from DEP Hosting! \\u2728&lt;\\/p&gt;\",\"fromName\":\"DEP Hosting\",\"fromEmail\":\"billing@dep.com.np\",\"copyTo\":[\"\"],\"blindCopyTo\":[\"\"],\"temporaryAttachments\":[]}', '2023-09-19 15:49:00', 0, 0, 0, 0, 0, NULL, NULL, '2023-09-19 15:50:15', '2023-09-19 15:56:31', NULL);
