nt.dep.com.np/\">https://client.dep.com.np/</a></p>\n<p>You will need your email address and the password you chose during signup to login.</p>\n<p>If you created an account as part of placing a new order with us, you will shortly receive an order confirmation email.</p>\n<p><strong>Getting Support</strong></p>\n<p>If you need any help or assistance, you can access our support resources below.</p>\n<ul>\n<li><a href=\"https://client.dep.com.np//knowledgebase.php\">Knowledgebase</a></li>\n<li><a href=\"https://client.dep.com.np//submitticket.php\">Submit a Ticket</a></li>\n</ul>\n<p>---<br />\r\nDEP Hosting<br />\r\nhttps://dep.com.np</p>\n<p><small>You are receiving this email because you recently created an account. If you did not do this, please contact us.</small></p><!-- message footer start -->\n</td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateFooter\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"footerContent\">\n                                                 <a href=\"https://client.dep.com.np\">visit our website</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/\">log in to your account</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/submitticket.php\">get support</a> <br />\n                                                Copyright  DEP Hosting, All rights reserved.\n                                            </td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                        </table>\n                    </td>\n                </tr>\n            </table>\n        </center>\n    </body>\n</html>', '2023-08-24 06:15:06', 'Madan Tamang <madkusanj@gmail.com>', '', 'info@dep.com.np', '[]', 0, NULL, 0, '', 0, NULL, '2023-08-24 06:15:06', 0),
