: Thursday, August 24th, 2023 \n</p>\n<p>\n<strong>Invoice Items</strong> \n</p>\n<p>\nDomain Registration - madantamang.com - 1 Year/s (24/08/2023 - 23/08/2024) 1,380.19<br>\n+ DNS Management<br>\n+ ID Protection<br>\n------------------------------------------------------<br>\nSub Total: 1,380.19<br>\nCredit: 0.00<br>\nTotal: 1,380.19 <br />\n------------------------------------------------------ \n</p>\n<p>\nYou can login to your client area to view and pay the invoice at <a href=\"https://client.dep.com.np/viewinvoice.php?id=7\">https://client.dep.com.np/viewinvoice.php?id=7</a> \n</p>\n<p>\n---<br />\r\nDEP Hosting<br />\r\nhttps://dep.com.np \n</p>\n<!-- message footer start -->\n</td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateFooter\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"footerContent\">\n                                                 <a href=\"https://client.dep.com.np\">visit our website</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/\">log in to your account</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/submitticket.php\">get support</a> <br />\n                                                Copyright  DEP Hosting, All rights reserved.\n                                            </td>\n                                        </tr>\n                                    </tabl