>\nDomain: digitalramnagar.com<br>\nFirst Payment Amount: 0.00<br>\nRecurring Amount: 2,899.00<br>\nBilling Cycle: Monthly<br>\n<br>\nTotal Due Today: 0.00 \n</p>\n<p>\nYou will receive an email from us shortly once your account has been setup. Please quote your order reference number if you wish to contact us about this order. \n</p>\n<p>\n---<br />\r\nDEP Hosting<br />\r\nhttps://dep.com.np\n</p>\n<!-- message footer start -->\n</td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateFooter\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"footerContent\">\n                                                 <a href=\"https://client.dep.com.np\">visit our website</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/\">log in to your account</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/submitticket.php\">get support</a> <br />\n                                                Copyright  DEP Hosting, All rights reserved.\n                                            </td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                        </table>\n                    </td>\n                </tr>\n            </table>\n        </center>\n    </body>\n</html>', '2023-09-19 15:21:24', 'Amulya Gol