(104, 4, 'Reseller Account Information', '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n    <head>\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\">\n        <style type=\"text/css\">\n            .ExternalClass,.ExternalClass div,.ExternalClass font,.ExternalClass p,.ExternalClass span,.ExternalClass td,h1,img{line-height:100%}h1,h2{display:block;font-family:Helvetica;font-style:normal;font-weight:700}#outlook a{padding:0}.ExternalClass,.ReadMsgBody{width:100%}a,blockquote,body,li,p,table,td{-webkit-text-size-adjust:100%;-ms-text-size-adjust:100%}table,td{mso-table-lspace:0;mso-table-rspace:0}img{-ms-interpolation-mode:bicubic;border:0;height:auto;outline:0;text-decoration:none}table{border-collapse:collapse!important}#bodyCell,#bodyTable,body{height:100%!important;margin:0;padding:0;width:100%!important}#bodyCell{padding:20px;}#templateContainer{width:600px;border:1px solid #ddd;background-color:#fff}#bodyTable,body{background-color:#FAFAFA}h1{color:#202020!important;font-size:26px;letter-spacing:normal;text-align:left;margin:0 0 10px}h2{color:#404040!important;font-size:20px;line-height:100%;letter-spacing:normal;text-align:left;margin:0 0 10px}h3,h4{display:block;font-style:italic;font-weight:400;letter-spacing:normal;text-align:left;margin:0 0 10px;font-family:Helvetica;line-height:100%}h3{color:#606060!important;font-size:16px}h4{color:grey!important;font-size:14px}.headerContent{background-color:#f8f8f8;border-bottom:1px solid #ddd;color:#505050;font-family:Helvetica;font-size:20px;font-weight:700;line-height:100%;text-align:left;vertical-align:middle;padding:0}.bodyContent,.footerContent{font-family:Helvetica;line-height:150%;text-align:left;}.footerContent{text-align:center}.bodyContent pre{padding:15px;background-color:#444;color:#f8f8f8;border:0}.bodyContent pre code{white-space:pre;word-break:normal;word-wrap:normal}.bodyContent table{margin:10px 0;background-color:#fff;border:1px solid #ddd}.bodyContent table th{padding:4px 10px;background-color:#f8f8f8;border:1px solid #ddd;font-weight:700;text-align:center}.bodyContent table td{padding:3px 8px;border:1px solid #ddd}.table-responsive{border:0}.bodyContent a{word-break:break-all}.headerContent a .yshortcuts,.headerContent a:link,.headerContent a:visited{color:#1f5d8c;font-weight:400;text-decoration:underline}#headerImage{height:auto;max-width:600px;padding:20px}#templateBody{background-color:#fff}.bodyContent{color:#505050;font-size:14px;padding:20px}.bodyContent a .yshortcuts,.bodyContent a:link,.bodyContent a:visited{color:#1f5d8c;font-weight:400;text-decoration:underline}.bodyContent a:hover{text-decoration:none}.bodyContent img{display:inline;height:auto;max-width:560px}.footerContent{color:grey;font-size:12px;padding:20px}.footerContent a .yshortcuts,.footerContent a span,.footerContent a:link,.footerContent a:visited{color:#606060;font-weight:400;text-decoration:underline}@media only screen and (max-width:640px){h1,h2,h3,h4{line-height:100%!important}#templateContainer{max-width:600px!important;width:100%!important}#templateContainer,body{width:100%!important}a,blockquote,body,li,p,table,td{-webkit-text-size-adjust:none!important}body{min-width:100%!important}#bodyCell{padding:10px!important}h1{font-size:24px!important}h2{font-size:20px!important}h3{font-size:18px!important}h4{font-size:16px!important}#templatePreheader{display:none!important}.headerContent{font-size:20px!important;line-height:125%!important}.footerContent{font-size:14px!important;line-height:115%!important}.footerContent a{display:block!important}.hide-mobile{display:none;}}\n        </style>\n    </head>\n    <body leftmargin=\"0\" marginwidth=\"0\" topmargin=\"0\" marginheight=\"0\" offset=\"0\">\n        <center>\n            <table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" height=\"100%\" width=\"100%\" id=\"bodyTable\">\n                <tr>\n                    <td align=\"center\" valign=\"top\" id=\"bodyCell\">\n                        <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainer\">\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateHeader\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"headerContent\">\n                                                <a href=\"https://client.dep.com.np\">\n                                                                                                            <img src=\"https://client.dep.com.np/assets/img/logo.png\" style=\"max-width:600px;padding:20px 20px 0 20px\" id=\"headerImage\" alt=\"DEP Hosting\" />\n                                                                                                    </a>\n                                            </td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateBody\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"bodyContent\">\n<!-- message header end --><p align=\"center\">\n<strong>PLEASE PRINT THIS MESSAGE FOR YOUR RECORDS - PLEASE READ THIS EMAIL IN FULL.</strong>\n</p>\n<p>\nIf you have requested a domain name during sign up then this will not be visible on the internet for between 24 and 72 hours. This process is called Propagation. Until your domain has Propagated your website and email will not function, we have provided a temporary url which you may use to view your website and upload files in the meantime.\n</p>\n<p>\nDear Amulya Golchha,\n</p>\n<p>\nThe reseller hosting account for digitalramnagar.com has been set up. The username and password below are for both cPanel to manage the website at digitalramnagar.com and WebHostManager to manage your Reseller Account.\n</p>\n<p>\n<strong>New Account Info</strong>\n</p>\n<p>\nDomain: digitalramnagar.com<br />\nUsername: digitalr<br />\nPassword: 819Kbo9bXw<br />\nHosting Package: Grow\n</p>\n<p>\nControl Panel: <a href=\"http://152.70.78.137:2082/\">http://152.70.78.137:2082/</a><br />\nWeb Host Manager: <a href=\"http://152.70.78.137:2086/\">http://152.70.78.137:2086/</a>\n</p>\n<p>\n-------------------------------------------------------------------------------------------- <br />\n<strong>Web Host Manager Quick Start</strong> <br />\n-------------------------------------------------------------------------------------------- <br />\n<br />\nTo access your Web Host Manager, use the following address:<br />\n<br />\n<a href=\"http://152.70.78.137:2086/\">http://152.70.78.137:2086/</a><br />\n<br />\nThe <strong>http://</strong> must be in the address line to connect to port :2086 <br />\nPlease use the username/password given above. <br />\n<br />\n<strong><em>To Create a New Account <br />\n</em></strong><br />\nThe first thing you need to do is scroll down on the left and click on &#39Add Package&#39 so that you can create your own hosting packages. You cannot install a domain onto your account without first creating packages.<br />\n<br />\n1. Click on &#39Create a New Account&#39 from the left hand side menu <br />\n2. Put the domain in the &#39Domain&#39 box (no www or http or spaces ? just domainname.com). After putting in the domain, hit TAB and it will automatically create a username. Also, enter a password for the account.<br />\n3. Your package selection should be one that you created earlier <br />\n4. Then press the create button <br />\n<br />\nThis will give you a confirmation page (you should print this for your records)\n</p>\n<p>\nPlease do not click on anything that you are not sure what it does. Please do not try to alter the WHM Theme from the selection box - fatal errors may occur. \n</p>\n<p>\n-------------------------------------------------------------------------------------------- \n</p>\n<p>\nTemporarily you may use one of the addresses given below manage your web site\n</p>\n<p>\nTemporary FTP Hostname: 152.70.78.137<br />\nTemporary Webpage URL: <a href=\"http://152.70.78.137/~digitalr/\">http://152.70.78.137/~digitalr/</a><br />\nTemporary Control Panel: <a href=\"http://152.70.78.137/cpanel\">http://152.70.78.137/cpanel</a>\n</p>\n<p>\nOnce your domain has Propagated\n</p>\n<p>\nFTP Hostname: www.digitalramnagar.com<br />\nWebpage URL: <a href=\"http://www.digitalramnagar.com\">http://www.digitalramnagar.com</a><br />\nControl Panel: <a href=\"http://www.digitalramnagar.com/cpanel\">http://www.digitalramnagar.com/cpanel</a><br />\nWeb Host Manager: <a href=\"http://www.digitalramnagar.com/whm\">http://www.digitalramnagar.com/whm</a>\n</p>\n<p>\n<strong>Mail settings</strong>\n</p>\n<p>\nCatch all email with your default email account\n</p>\n<p>\nPOP3 Host Address : mail.digitalramnagar.com<br />\nSMTP Host Address: mail.digitalramnagar.com<br />\nUsername: digitalr<br />\nPassword: 819Kbo9bXw\n</p>\n<p>\nAdditional mail accounts that you add\n</p>\n<p>\nPOP3 Host Address : mail.digitalramnagar.com<br />\nSMTP Host Address: mail.digitalramnagar.com<br />\nUsername : The FULL email address that you are picking up from (e.g. info@example.com). <br />\nIf your email client cannot accept a @ symbol, then you may replace this with a backslash .<br />\nPassword : As specified in your control panel \n</p>\n<p>\nThank you for choosing us.\n</p>\n<p>\n---<br />\r\nDEP Hosting<br />\r\nhttps://dep.com.np\n</p>\n<!-- message footer start -->\n</td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                            <tr>\n                                <td align=\"center\" valign=\"top\">\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateFooter\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"footerContent\">\n                                                 <a href=\"https://client.dep.com.np\">visit our website</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/\">log in to your account</a>\n                                                <span class=\"hide-mobile\"> | </span>\n                                                <a href=\"https://client.dep.com.np/submitticket.php\">get support</a> <br />\n                                                Copyright  DEP Hosting, All rights reserved.\n                                            </td>\n                                        </tr>\n                                    </table>\n                                </td>\n                            </tr>\n                        </table>\n                    </td>\n                </tr>\n            </table>\n        </center>\n    </body>\n</html>', '2023-09-19 15:23:03', 'Amulya Golchha <roshangharti98@gmail.com>', '', 'info@dep.com.np', '[]', 0, NULL, 0, '', 0, NULL, '2023-09-19 15:23:03', 0),
