INSERT INTO `tblticketreplies` (`id`, `tid`, `userid`, `contactid`, `requestor_id`, `name`, `email`, `date`, `message`, `admin`, `attachment`, `attachments_removed`, `rating`, `editor`) VALUES
(1, 2, 0, 0, 0, '', '', '2023-09-06 16:21:23', 'Dear sir,\r\n\r\nThank you for reaching out to our hosting support team. We have received your ticket regarding the technical issue you&#039;re experiencing, and we appreciate your patience.\r\n\r\nI want to assure you that your concern is important to us, and we are actively investigating the issue you&#039;ve reported. Our technical team is currently reviewing the details you provided to identify the root cause and work towards a resolution.\r\n\r\nRest assured that we are committed to resolving this matter as quickly and efficiently as possible. In the meantime, if you have any additional information or observations related to the issue, please don&#039;t hesitate to share them with us. This will help us expedite the troubleshooting process.\r\n\r\nWe understand the impact that technical issues can have on your hosting experience, and we apologize for any inconvenience this may have caused. We will keep you updated on our progress and provide you with a follow-up as soon as we have more information or a solution to share.\r\n\r\nIf you have any urgent concerns or questions in the meantime, please don&#039;t hesitate to reach out to our support team. We are here to assist you.\r\n\r\nOnce again, thank you for bringing this to our attention, and we appreciate your understanding while we work towards resolving the issue.\r\n\r\nBest Regards,\r\nTechnical Support Team', 'Support Staff', '', 0, 0, 'markdown'),
(2, 2, 0, 0, 0, '', '', '2023-09-08 08:33:26', 'Dear sir,\r\n\r\nWe are pleased to inform you that the FTP problem you reported has been successfully resolved.\r\n\r\nOur technical team worked diligently to identify and address the underlying issue, ensuring that you can now use FTP services without any disruptions. You should be able to access your files and manage your hosting environment seamlessly.\r\n\r\nWe understand that technical issues can be frustrating, and we appreciate your patience and cooperation throughout the resolution process.\r\n\r\nIf you encounter any further difficulties or have any questions related to your hosting services, please do not hesitate to reach out to our support team. We are here to assist you and ensure your hosting experience is smooth and trouble-free.\r\n\r\nOnce again, thank you for choosing our hosting services, and please feel free to contact us if you require any additional assistance or have any other concerns in the future.\r\n\r\nBest Regards,\r\nTechnical Support Team', 'Support Staff', '', 0, 0, 'markdown');
