ng a custom theme for help doing this.<\\/p>\"}],\"danger\":[{\"name\":\"phpVersion\",\"type\":\"PHP\",\"severityLevel\":\"error\",\"body\":\"<p>Your PHP version <strong>7.3.33<\\/strong> is supported by WHMCS. <\\/p><p>The PHP 7.3 branch has reached end of life status and will not receive critical bug or security fixes. Please see <a href=\\\"https:\\/\\/docs.whmcs.com\\/System_Environment_Guide#PHP_Version\\\">our documentation<\\/a> for more information.<\\/p>\"},{\"name\":\"cron\",\"type\":\"WHMCS\",\"severityLevel\":\"error\",\"body\":\"<p>The system cron does not appear to have completed successfully within the last 24 hours. Check your activity logs or learn more about enabling the cron in our <a href=\\\"https:\\/\\/docs.whmcs.com\\/Cron_Tasks\\\">documentation<\\/a>.<\\/p>\"}]}}', 1695724465),
