se},{\"slug\":\"other\",\"name\":\"Other\",\"tagline\":\"Apps that didn\'t fit into any other category!\",\"moduleType\":\"addons\",\"featured\":{\"default\":[]},\"exclusions\":[\"addons.bulkpricingupdater\",\"addons.google_analytics\",\"addons.import_assist\",\"addons.licensing\",\"addons.mailchimp\",\"addons.project_management\",\"addons.paypal_addon\",\"addons.staffboard\",\"addons.whmcslicenses\"],\"additions\":[\"addons.newtlds\"],\"icon\":\"fas fa-university\",\"includeInHomeFeatured\":false}],\"apps\":{\"servers.cpanel\":{\"schema\":\"1.0\",\"badges\":{\"popular\":true}},\"addons.licensing\":{\"schema\":\"1.0\",\"hidden\":true},\"servers.licensing\":{\"schema\":\"1.0\",\"purchase\":{\"price\":\"99.95\",\"currency\":\"USD\",\"term\":\"One Time\",\"url\":\"https:\\/\\/www.whmcs.com\\/software-licensing\\/\"}},\"addons.project_management\":{\"schema\":\"1.0\",\"purchase\":{\"price\":\"99.95\",\"currency\":\"USD\",\"term\":\"One Time\",\"url\":\"https:\\/\\/www.whmcs.com\\/project-management\\/\"}},\"gateways.tco\":{\"schema\":\"1.0\",\"support\":{\"homepage\":\"https:\\/\\/www.2checkout.com\\/signup?p=signup&r=whmcs2co\"}},\"gateways.skrill\":{\"schema\":\"1.0\",\"description\":{\"long\":\"Skrill\'s payment network provides more than 100 payment options, with 40 currencies covering 200 countries and territories.\\n\\n* Accept all major credit cards directly on your site\\n* Quick and easy integration\\n* Highest security standards\\n* Integrated risk management\\n\\n\\n\\n[Click to learn more and signup](http:\\/\\/go.whmcs.com\\/558\\/skrill-signup)\\n\\n\\n## Special Offer \\nThe payment platform comes with an exclusive reduced fee offer of 0.9% on Debit Card\\/Prepaid Card\\/Credit Card (VISA, Mastercard, Maestro) transactions, and 0.5% fees on Rapid Transfer transactions.\\nFees apply to new merchants only within restricted industry sectors. [Terms and conditions apply](https:\\/\\/www.skrill.com\\/en\\/footer\\/terms-conditions\\/fees-reduction-promotion\\/).\",\"features\":[]},\"support\":{\"homepage\":\"https:\\/\\/signup.skrill.com\\/business\\/#\\/contact?lang=EN&rid=96648253\"}},\"gateways.eway\":{\"schema\":\"1.0\",\"support\":{\"homepage\":\"https:\\/\\/my.eway.io\\/whmcs\"}},\"gateways.authorize\":{\"schema\":\"1.0\",\"support\":{\"homepage\":\"https:\\/\\/www.evopayments.us\\/accept-payments\\/whmcs\\/\"}},\"registrars.godaddy\":{\"schema\":\"1.0\",\"type\":\"whmcs-registrars\",\"name\":\"godaddy\",\"category\":\"domains\",\"description\":{\"name\":\"GoDaddy\",\"tagline\":\"Industry-leading domain registrar with over 77M domain names.\",\"long\":\"GoDaddy powers the world\\u2019s largest cloud platform. With 18.5M+ customers worldwide and 77M+ domain names under management, GoDaddy is the registrar of choice for more domain names than any other ICANN-acreddited registrar.\\n\\nNow with the GoDaddy module for WHMCS, you can resell domains using the GoDaddy domain reseller platform. To get started, download the module from the WHMCS Marketplace using the link to the right.\\n\\nSignup for a GoDaddy account @ [https:\\/\\/reseller.godaddy.com\\/whmcs](https:\\/\\/reseller.godaddy.com\\/whmcs)\\n\\n## Reasons to Choose GoDaddy\\n* Trusted partner and champion of our customers.\\n* Large, high growth business with attractive unit economics.\\n* Industry-leading products built on a single cloud platform & distinctive customer care.\\n* Proven growth strategy with team purpose built to execute.\\n* Market Leading Wholesale Domain Pricing.\"},\"marketplace\":{\"url\":\"https:\\/\\/marketplace.whmcs.com\\/product\\/4864\"},\"logo\":{\"remote_uri\":\"https:\\/\\/appsfeed.whmcs.com\\/logos\\/godaddy-v2.png\"},\"support\":{\"homepage\":\"https:\\/\\/www.godaddy.com\\/\",\"learn_more\":\"https:\\/\\/www.whmcs.com\\/godaddy\",\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/GoDaddy\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"gateways.paypalcheckout\":{\"schema\":\"1.0\",\"description\":{\"tagline\":\"Choose the name trusted by 320M+ global shoppers\",\"long\":\"## Help grow your business with Paypal and WHMCS\\n\\n\\nYour checkout can be more powerful than you think. Payment providers can play a key role in conversion and trust, with a checkout that enhances your brand experience and streamlines your business.  Paypal offers a complete solution that simplifies payments and powers your business with these key benefits:\\n\\n* Support for popular payment methods including credit and debit cards, multiple local payment methods, and Paypal.\\n* No monthly fees, and fast access to funds.\\n* Accept payments in more that 100 currencies and 200 countries.\\n* Seamless, mobile-optimized checkout that speeds sales - customer can pay directly from product pages with fewer clicks.\\n* Best-in-class fraud protection with PSD2 Stronger Customer Authentication that speeds checkout, especially on mobile devices.\",\"features\":[]}},\"gateways.ewayv4\":{\"schema\":\"1.0\",\"description\":{\"tagline\":\"Accept secure payments, automate refunds, and more\",\"long\":\"Our integration with eWAY lets you accept secure payments through credit cards, digital wallets, and other methods.\\n\\nOur integration lets your customers store payment data through tokenized remote storage, letting you charge recurring payments and renewals instantly. We also automate refunds through this gateway.\",\"features\":[\"Accept secure payments through many payment methods.\",\"Store payment data with tokenized remote storage.\",\"Automate recurring payments.\",\"Automate refunds.\"]},\"support\":{\"homepage\":\"https:\\/\\/eway.io\\/\",\"learn_more\":\"https:\\/\\/my.eway.io\\/whmcs\",\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/EWAY\"}}},\"additional_apps\":{\"marketconnect.symantec\":{\"schema\":\"1.0\",\"type\":\"whmcs-marketconnect\",\"name\":\"symantec\",\"category\":\"digitalservices\",\"description\":{\"name\":\"DigiCert\",\"tagline\":\"A market leading SSL provider of RapidSSL, Ge