ace.whmcs.com\\/help\\/connect\\/kb\\/spamexperts_email_services\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/connect\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"marketconnect.codeguard\":{\"schema\":\"1.0\",\"type\":\"whmcs-marketconnect\",\"name\":\"codeguard\",\"category\":\"digitalservices\",\"description\":{\"name\":\"CodeGuard\",\"tagline\":\"Website backup and protection against threats and data loss.\",\"long\":\"CodeGuard Website Backup is the perfect accompaniment to any existing backup strategy. With CodeGuard website backup, you enable customers to have an independent off-site backup performed and stored by a 3rd party that ensures they always have a copy of their website in the event of disaster.\",\"features\":[\"Automated daily backups with one-click restore\",\"Automated provisioning of SSH and SFTP access\",\"WordPress Plugin for automated daily backups\",\"Automatic WordPress updates, testing and rollback of failed updates\"]},\"logo\":{\"asset_filename\":\"marketconnect\\/codeguard\\/logo.png\"},\"support\":{\"homepage\":\"https:\\/\\/www.codeguard.com\\/\",\"docs_url\":\"https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/codeguard_website_backup\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/connect\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"marketconnect.sitelockvpn\":{\"schema\":\"1.0\",\"type\":\"whmcs-marketconnect\",\"name\":\"sitelockvpn\",\"category\":\"digitalservices\",\"description\":{\"name\":\"SiteLock VPN\",\"tagline\":\"Anonymous and secure internet browsing with VPN.\",\"long\":\"Offer High Speed, Secure, and Easy to Use VPN Security and Protection for Web Browsing.\\n## What is VPN?\\n\\nA VPN, or virtual private network, is a secure tunnel between your device and the internet. VPNs are used to protect your online traffic from snooping, interference, and censorship.\\n\\n## Why should I offer VPN to my customers?\\n\\nEven if someone has nothing to hide, often people don\\u2019t like the idea of being watched and tracked. In addition, a VPN allows you to connect to servers in many different locations, bypassing censorship and geo-restrictions.\\nMore and more people are choosing to use a VPN for greater online privacy and general security and a web hosting provider is a natural fit for consumers to obtain their VPN service from.\\n\\n## New to WHMCS MarketConnect?\\n\\n[Learn more and get started by clicking here](https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/overview\\/getting_started\\/activate_marketconnect)\"},\"logo\":{\"asset_filename\":\"marketconnect\\/sitelockvpn\\/logo.png\"},\"support\":{\"homepage\":\"https:\\/\\/www.sitelock.com\\/products\\/purchase-vpn\",\"docs_url\":\"https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/sitelock_vpn\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/connect\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"marketconnect.marketgoo\":{\"schema\":\"1.0\",\"type\":\"whmcs-marketconnect\",\"name\":\"marketgoo\",\"category\":\"digitalservices\",\"description\":{\"name\":\"marketgoo\",\"tagline\":\"Resellable SEO Tools for Web Hosting Providers.\",\"long\":\"Get more renewals and increase customer spend by helping your customers get the traffic and search rankings they want - no technical skills required.\\n\\nDifferentiate your services by offering your customers an SEO tool that will get real results for their business. How does it work? It\\u2019s easy as 1-2-3 for you and for your customers.\\n\\n* After you enable marketgoo, your customers will be able to sign up for marketgoo lite, which will scan their site and instantly provide an SEO Report and Improvement Plan.\\n* The customer can use it as a checklist to improve their SEO issues, track and optimize for a few keywords and download their PDF Report every month.\\n* If they want step-by-step instructions on how to make all the recommended improvements, along with more keyword optimization and competitor monitoring, they can upgrade to marketgoo PRO.\\n\\n## New to WHMCS MarketConnect?\\n\\n[Learn more and get started by clicking here](https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/overview\\/getting_started\\/activate_marketconnect)\"},\"logo\":{\"asset_filename\":\"marketconnect\\/marketgoo\\/logo.png\"},\"support\":{\"homepage\":\"https:\\/\\/www.marketgoo.com\\/\",\"docs_url\":\"https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/marketgoo\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/connect\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"marketconnect.ox\":{\"schema\":\"1.0\",\"type\":\"whmcs-marketconnect\",\"name\":\"ox\",\"category\":\"digitalservices\",\"description\":{\"name\":\"OX App Suite\",\"tagline\":\"Offer feature-rich, secure and reliable professional email.\",\"long\":\"App Suite from Open-Xchange is a full-stack email platform; offering your customers all the features they need at a price they can easily afford.\\n\\n* Reliable 99.9% Uptime\\n* Premium Spam &Virus Protection\\n* Robust Webmail built for SMBs and Prosumers\\n* Shared calendaring, contacts and tasks\\n* 10GB mailbox and 50GB mailbox\\/drive storage\\n* Access email via desktop or native mobile apps (IMAP)\\n* Cloud File Storgage and Online Office Apps (available)\\n\\nAvailable via WHMCS MarketConnect, you can start reselling OX App Suite in minutes, with ready made landing pages, promotions and no need to deposit anything until you get your first sale.\\n\\n*Available in WHMCS 8.0 and later.*\\n\\n## New to WHMCS MarketConnect?\\n\\n[Learn more and get started by clicking here](https:\\/\\/marketplace.whmcs.com\\/help\\/connect\\/kb\\/overview\\/getting_started\\/activate_marketconnect)\"},\"logo\":{\"remote_uri\":\"https:\\/\\/appsfeed.whmcs.com\\/logos\\/oxappsuite.png\"},\"support\":{\"homepage\":\"https:\\/\\/oxappsuite.io\\/en\\/\