m\\/product\\/38\"},\"support\":{\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/Claim_Your_.UK_Addon\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/product\\/38\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"addons.configurablepackageaddon\":{\"schema\":\"1.0\",\"type\":\"whmcs-addons\",\"name\":\"configurablepackageaddon\",\"category\":\"utilities\",\"description\":{\"name\":\"Configurable Package Addon\",\"tagline\":\"Build and sell customisable web hosting packages with auto provisioning\",\"long\":\"Set your business apart from other web hosts\\u2026 The customisable package addon lets your customers choose exactly what they want\\/need from their hosting package and have it automatically provisioned onto your server.\",\"features\":[\"Let your clients customise their hosting package and pay just for what they need\",\"Fully automated initial account setup based on selections\",\"Automated upgrades\\/downgrades calculations & provisioning\",\"cPanel & DirectAdmin Supported for Automation\"]},\"logo\":{\"remote_uri\":\"https:\\/\\/appsfeed.whmcs.com\\/logos\\/whmcsconfigpackageaddon.png\"},\"marketplace\":{\"url\":\"https:\\/\\/marketplace.whmcs.com\\/product\\/30\"},\"support\":{\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/Configurable_Package_Addon\",\"learn_more\":\"https:\\/\\/marketplace.whmcs.com\\/product\\/30\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"gateways.stripe\":{\"schema\":\"1.0\",\"type\":\"whmcs-gateways\",\"name\":\"stripe\",\"category\":\"payments\",\"description\":{\"name\":\"Stripe\",\"tagline\":\"A popular secure tokenised credit card merchant solution.\",\"long\":\"Stripe is one of the world\\u2019s leading online payment service providers.  Stripe makes it easy to accept credit card transactions, ACH payments, and alternative payment methods in over 135 different currencies and securely manage an online business.\\n\\n\\n# Why use Stripe?\\n* Accept all major debit and credit cards\\n* Benefit from Stripe Elements, which helps your users input their payment information quickly and correctly at checkout\\n* Better detect and prevent fraud with the help of Stripe Radar and optional 3D Secure\\n* Achieve PCI-DSS compliance with Stripe Elements hosted input fields\\n* Benefit from free updates and new innovative functionality as Stripe launches new features and products\\n\\n[**Sign Up today!**](https:\\/\\/dashboard.stripe.com\\/register)\"},\"logo\":{\"remote_uri\":\"https:\\/\\/appsfeed.whmcs.com\\/logos\\/stripe.png\"},\"support\":{\"homepage\":\"https:\\/\\/stripe.com\\/en-es\\/payments\\/elements\",\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/Stripe\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]},\"fraud.validationcom\":{\"schema\":\"1.0\",\"type\":\"whmcs-fraud\",\"name\":\"validationcom\",\"min_version\":\"8.2.0-alpha.1\",\"category\":\"orders\",\"description\":{\"name\":\"Validation.com\",\"tagline\":\"User identity verification made easy. Verify people like you do in person.\",\"long\":\"Validation.com puts you in charge of the client ID verification process. Created to stop bad actors in their tracks.\\n\\nWith user identity verification, your customers are required to supply identifying documents through the Client Area. Their verification status will display throughout the WHMCS Admin Area.\\n\\nWHMCS can initiate this automatically after a failed fraud protection check or you can initiate it manually. It helps to streamline the process of managing fraudulent orders.\\n\\n* No long-term commitments\\n* No facial recognition\\n* GDPR Compliant\\n* PCI DSS - Level 1 SP Certified\\n\\nAs a WHMCS user, it\'s easy to get started with Validation.com:\\n\\n* All WHMCS license holders can get up to 5 checks every month for just $5\\/month.\\n* WHMCS Business 10k license holders or higher receive a $100 monthly credit toward their Validation.com usage. That\'s the equivalent of 200 reviews and 5 agents.\\n\\nTo get started, simply navigate to **Configuration > System Settings > Fraud Protection** and select Validation.com.\"},\"logo\":{\"remote_uri\":\"https:\\/\\/appsfeed.whmcs.com\\/logos\\/validationcom.png\"},\"support\":{\"homepage\":\"https:\\/\\/validation.com\\/\",\"docs_url\":\"https:\\/\\/docs.whmcs.com\\/User_Identity_Verification\",\"learn_more\":\"https:\\/\\/blog.whmcs.com\\/133699\\/new-in-whmcs-82-user-identity-verification\"},\"authors\":[{\"name\":\"WHMCS\",\"homepage\":\"https:\\/\\/www.whmcs.com\\/\"}]}}}', 1695740216);
